message:
? CONCOURS TERMINÉ ? L’émission est diffusée en direct de la Place des Arts de Montréal aujourd’hui. Pour souligner l’occasion, on a deux lots à faire tirer! Chaque prix contient: 
-Le disque «Noël en noir et blanc» de Marc Hervieux et Gregory Charles;
-Une tuque et un cordon de cellulaire d’ICI Radio-Canada Première;
-Une tasse à l’effigie de Gravel le matin;
-Un lot contiendra un laissez-passer double pour le film «Junior Majeur» d’Éric Tessier et l’autre contiendra un laissez-passer double pour le film «Trip à trois», mettant en vedette Mélissa Désormeaux-Poulin et Martin Matte.

Pour participer, dites-nous, dans le fil de commentaires, quelle est votre chanson de Noël favorite !

Dépêchez-vous! Vous avez jusqu’à 12h00! ?

Voici les demandes que Montréal a faites à Ottawa pour le futur pont Champlain, hier -> http://bit.ly/Tvaw0Z

-un système léger sur rails pour le transport collectif;
-un système de péage, à condition qu'une partie de l'argent soit investie dans le transport en commun;
-un concours de design architectural international pour la conception.  

Auriez-vous fait les mêmes demandes?
